    return (
        <div className="videoCard">
            <img src={`${base_url}${movie.backdrop_path || movie.poster_path}`}
            alt={movie.title}/>
            <h2>{movie.title}</h2>
            <p>titlke</p>
            <p>{movie.like}</p>
        </div>
    )
}

